    public function uploadAction() {
        $request = $this->getRequest()->request;
        // $image1 = $request->get('image1');
        // $image2 = $request->get('image2');
        // $image3 = $request->get('image3');
        $image = $request->get('image');
        if (count($image) < 1) {
            $response = new JsonResponse();
            $response->setData(array('code' => 2, 'msg' => '请至少上传一张图片'));
            return $response; 
        }
        $image1 = $image[0];
        $image2 = isset($image[1]) ? $image[1] : $image[0];
        $image3 = isset($image[2]) ? $image[2] : $image[0];
        $tpl_no = $request->get('style');
    	$image = $this->container->get('givenchy.image.service');

        // $tpl_no = "one";
        // $image1= '';
        // $image2= '';
        // $image3= ''; 
       
        $image1 = $image->createImage($image1);
        $image2 = $image->createImage($image2);
        $image3 = $image->createImage($image3);
    	$data = array(
            'images' => array(
                base64_encode(file_get_contents($image->createImageForVideo($tpl_no, '1', $image1))),
                base64_encode(file_get_contents($image->createImageForVideo($tpl_no, '2', $image2))),
                base64_encode(file_get_contents($image->createImageForVideo($tpl_no, '3', $image3))),
            ),
            'tpl_no' => $tpl_no,
        );
        $video_json = $image->createVideo($data);
        $video_json = json_decode($video_json, true);
        $video = $video_json['src'];
        $url = $image->saveVideoToHost($video);
        $user = $this->container->get('givenchy.user.service');
        $video_id = $user->saveVideo($url);
        $response = new JsonResponse();
        $response->setData(array('code' => 1, 'msg' => $video_id));
        return $response; 

    }

    public function infoAction() {
    	$request = $this->getRequest()->request;
        $user = $this->container->get('givenchy.user.service');
        $user->userLogin($request->get('name'), $request->get('mobile'));
        $response = new JsonResponse();
        $response->setData(array('code' => 1, 'msg' => '提交成功'));
        return $response;    
    }

    public function getvideoAction() {
        $user = $this->container->get('givenchy.user.service');
        $request = $this->getRequest()->request;
        $id = $request->get('id');
        $video = $user->getVideoById($id);
        $session_id = $this->getRequest()->getSession()->get('user');
        if($video->getInfo()->getId() == $session_id) {
            $ismy = 1;
        } else {
            $ismy = 0;
        }
        $data = array(
            'url' => $video->getUrl(),
            'ballot' => $video->getBallot(),
            'ismy' => $ismy
        );
        $response = new JsonResponse();
        $response->setData(array('code' => 1, 'msg' => $data));
        return $response;  
    }

    public function ballotAction() {
        $user = $this->container->get('givenchy.user.service');
        $request = $this->getRequest()->request;
        $id = $request->get('id');
        $ballot = $user->ballotVideoById($id);
        $response = new JsonResponse();
        $response->setData(array('code' => 1, 'msg' => $ballot));
        return $response;
    }

    public function checkAction() {
        $request = $this->getRequest()->request;
        $user = $this->container->get('givenchy.user.service');
        $mobile = $request->get('mobile');
        //$mobile='15121038676';
        if (!$info = $user->checkMobile($mobile)) {
            $response = new JsonResponse();
            $response->setData(array('code' => 0, 'msg' => '您未参加上一波活动'));
            return $response;
        }
        $count = $user->getUserBallot($info);
        $canballot = $user->checkStatus($mobile);
        $this->getRequest()->getSession()->set('user', $info->getId());
        $response = new JsonResponse();
        $response->setData(array('code' => 1, 'msg' => '验证通过', 'ballot'=> $count, 'canballot'=> $canballot));
        return $response;
        
    }

    public function lotteryAction() {
        exit;
